import React from "react";
const CreateNote = () => {
   
    return (
        <>
          <form>
         <div className="main_note">
              <form >
                  <input type="text" placeholder="Title" />
                  <textarea name="" id="" cols="30" rows="10"></textarea>
              </form>
         </div>
        
</form>

        </>
    )
}
export default CreateNote;
